INSERT INTO public."Generator_task" VALUES (21, '<p><img src="data:image/png;base64,"></p><p>Автомобильное колесо представляет собой металлический диск с установленной на него резиновой шиной. Диаметр диска совпадает с диаметром внутреннего отверстия в шине.</p><p>Для маркировки автомобильных шин применяется единая система обозначений. Например, 195/65 R15 (рис.~1). Первое число означает ширину шины $B$ в миллиметрах (рис.~2). Второе число --- высоту боковины шины $H$ в процентах от ширины шины. Например, шина с маркировкой 195/65 R15 имеет ширину $B = 195$ мм и высоту боковины\[<br>H = 195 \cdot 0{,}65 = 126{,}75 \text{ мм}.<br>\] Буква R означает, что шина имеет радиальную конструкцию, то есть нити каркаса в боковине шины расположены вдоль радиусов колеса. Такие шины применяются на всех легковых автомобилях.</p><p>За буквой R следует диаметр диска $d$ в дюймах (в одном дюйме $25{,}4$ мм). Таким образом, общий диаметр колеса $D$ можно найти, зная диаметр диска и высоту боковины:\[<br>D = 2H + 25{,}4d.<br>\] Завод производит легковые автомобили определённой модели и устанавливает на них колёса с шинами 175/70 R12.<br>&nbsp;</p><p>Шины какой наибольшей ширины можно устанавливать на автомобиль, если диаметр диска равен 13 дюймам? Ответ дайте в миллиметрах.</p>', '195', '2026-02-14 16:02:52+03', 'ADMIN', 17, '');
INSERT INTO public."Generator_task" VALUES (22, 'Сколько миллиметров составляет высота боковины шины, имеющей маркировку 165/65 R14?', '107,25', '2026-02-14 16:02:52.589868+03', 'ADMIN', 18, NULL);
